    "Notes": "A final Lake or Streambed Alteration Agreement (LSA) or written verification that an LSA is not needed is required from the CA Department of Fish and Wildlife (CDFW) for every cannabis cultivation application, regardless of license type. \nOne of the following is required: \n1) If you have received a final LSA or written verification document, provide that. If you received an EPIMS email from CDFW stating that you do not need an LSA, you must provide the application form that was submitted to CDFW.   \n2) If you have applied for an LSA from CDFW but have not received the final document, provide the notification (application) form or draft LSA and state that you do not have the final document in the Resolution box of the deficiency record. \n3) If you have not started the process with CDFW and you are an outdoor or mixed-light applicant, it is recommended that you submit a notification form. If you are an indoor applicant, it is recommended that you submit a self-certification. \nVisit  https://www.wildlife.ca.gov/Conservation/Cannabis/Permitting for more information. All questions about the LSA process and requirements should be directed to one of the regional CDFW offices."
